import React from 'react';
import './App.css';
import Bar from './bar';

function Visualizer() {

    return (
      <div className="visualizer-container">
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
          <Bar/>
      </div>
    );
  }
  
  export default Visualizer;
